"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e={greeting:"Hello!",im:"I'm",quick_self_desc:"IT student and aspiring",full_desc:"I'm interested in developing web apps and pages with the use of the newest technologies for about four years. In my free time, I practicing my skills and broadening my knowledge about React.js by making projects that I put up on my Github. Endurance and determination help me in realizing certain goals. Furthermore, my experience with different languages allows me easier and more effective absorption of new techs. Familiarity with the English language is another advantage as it allows me to freely read documentations. My purpose is to earn commercial experience by working with professionals.",my_stack:{coffee:"Coffee",thinking:"Analytic thinkink",curiosity:"Curiosity"},info_titles:{uni:"University",email:"e-mail",github:"Github"},uni:"Cracow University of Technology",btn_projects:"See my projects",btn_aboutme:"About me",technologies:"Technology stack",spanish_app:{title:"App for learning words",desc:"I'm into learning spanish, so when I discovered that I lack some sort of tool to revise my vocabulary I started working on this project. React.js allowed me to keep this app small and simple but effective. Using Firebase I'm able to store different users dictionaries allowing them to use it on whatever device they wish to. As a user you can manage your set of words by adding or removing them as well as practising. With friendly and nice to look at UI, everyone should have fun using this web application!",link:"Try me on GitHub"},mobile_app:{title:"App for tasks and chores",desc:"There are a million apps like this on the app store so why shouldn't I try making one myself too? Making something for mobile is also an opportunity to do things differently. It's a very simple application allowing you to keep your daily tasks in one place, you can put them into categories so you always know where to find them. By using React Native I was able to develop my app on both Android and iOS devices with one code-base.",link:"Visit me on GitHub"},filterninja:{title:"App for editing filters",desc:"As a fan of a certain video game with a complex ecosystem of tools, I found myself in a situation where I needed something to edit a special kind of files called loot filters because editing them in a Notepad was unacceptable as there is a lot of depth to handle. So I started developing this app, by using Electron I'm able to use every tool that is available to desktop application programmers such as file system, etc. Using API enables me to offer users some special abilities when editing their filters such as fetching real-time game data from the web.",link:"Visit me on GitHub"},commando:{title:"C64 game port",desc:"My last JavaScript class assignment in high school was to make a remake of any Commodore64 game. I chose Commando when I was searching the web for some idea, as it's really fun to play fast-paced shooter. It was a really interesting project to do as I had to make everything from the ground-up. Moving, shooting, enemies and their AI, and many more. Despite having only one level it's a very engaging and hard game to play. You should give it a try!",link:"Play me on GitHub"}},t=e;exports.default=t;
